import React from 'react';

interface Props extends React.HTMLAttributes<HTMLImageElement> {
  width?: number;
  height?: number;
}

export default function Clock({ width = 20, height = 20, ...props }: Props) {
  return (
    <img
      width={width}
      height={height}
      {...props}
      src="data:image/png;base64,"
    />
  );
}
